import axios from 'axios';
import React, { useState } from 'react';

const List = () => {
  const[allpost,setallpost]=useState([]);
  axios.get("https://jsonplaceholder.typicode.com/posts").then(res=>{
    setallpost(res.data);
  })
  return
   <div>
    {allpost.slice(0, 10).map(data => (
      <h2 key={data.id}> huhuhu </h2>
    ))} </div>;
};

export default List;
